import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom"
import NavbarPublic from "../layouts/NavbarPublic/NavbarPublic";

function AdminPanel() {

  return (
    <div className="AdminPanel">
      <NavbarPublic/>
      <BrowserRouter>
      <Routes>
        {/* <Route path='/admin/profiles' element={<Profiles/>}></Route>
        <Route path='/admin/create' element={<AddProfileForm/>}></Route> */}
      </Routes>
      </BrowserRouter>
      <h2>Buscar Repo</h2>
    </div>
  );
}

export default AdminPanel;
